INSERT INTO `question` VALUES (143,'Deciding how much testing is enough should take into account:\ni. Level of Risk including Technical and Business product and project risk\nii. Project constraints such as time and budget\niii. Size of Testing Team\niv. Size of the Development Team\n',37,1,0,'C'),(144,'Test planning has which of the following major tasks?\ni. Determining the scope and risks, and identifying the objectives of testing.\nii. Determining the test approach (techniques, test items, coverage, identifying and interfacing the teams\ninvolved in testing, testware)\niii. Reviewing the Test Basis (such as requirements, architecture, design, interface)\niv. Determining the exit criteria.',37,2,0,'A'),(145,'Evaluating testability of the requirements and system are a part of which phase:',37,3,0,'A'),(146,'One of the fields on a form contains a text box which accepts alphabets in lower or upper case.\nIdentify the invalid Equivalence class value.',37,4,0,'D'),(147,'In a system designed to work out the tax to be paid:\nAn employee has £4000 of salary tax free. The next £1500 is taxed at 10% The next £28000 is\ntaxed at 22% Any further amount is taxed at 40% Which of these groups of numbers would fall\ninto the same equivalence class?',37,5,0,'D'),(148,'Which of the following has highest level of independence in which test cases are',37,6,0,'C'),(149,'We use the output of the requirement analysis, the requirement  specification as the input for writing:',37,7,0,'A'),(150,'Validation involves which of the following\ni. Helps to check the Quality of the Built Product\nii. Helps to check that we have built the right product.\niii. Helps in developing the product\niv. Monitoring tool wastage and obsoleteness.',37,8,0,'B'),(151,'Which of the following uses Impact Analysis most?',37,9,0,'D'),(152,'Repeated Testing of an already tested program, after modification, to discover any defects introduced or uncovered as a result of the changes in the software being tested or in